import { useEffect } from 'react';

function Home({ socket }) {

    const createRoom = () => {
        socket.emit("createRoom");
    }

    useEffect(() => {
        socket.on("createRoomResponse", (data) => {
            console.log(data.room);
        });
    }, [socket]);

    return (
        <div>
            <h3>Create A Room</h3>
            <button onClick={createRoom}>Create A Room</button>
        </div>
    );
}

export default Home;
